import { Component, OnInit } from '@angular/core';
import { Link } from '../../interfaces/link';

@Component({
  selector: 'appHeader',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.scss']
})
export class HeaderComponent implements OnInit {

  links: Array<Link>;
  authLinks: Array<Link>;
  constructor() {}

  ngOnInit(): void {
    this.links = [
      {
        label: 'Acceuil',
        url: '',
        icon: 'bx bx-home-alt',
        visible: true,
      },
      {
        label: 'Mes Cv',
        url: '',
        icon: 'bx bx-home-alt',
        visible: true,
      },
    ]
    this.links = [
      {
        label: 'S\'inscrire',
        url: '',
        icon: 'bx bx-home-alt',
        visible: true,
      },
      {
        label: 'Se connecter',
        url: '',
        icon: 'bx bx-home-alt',
        visible: true,
      },
    ]
  }

}
